import React from 'react'
import classes from './HeaderCart.module.css'

const HeaderCart = () => {
  return (
    <button className={classes.cart}>
      <span className={classes.icon}></span>
      <span className={classes.badge}>
        Your Cart</span>
      <span>2</span>
    </button>
  )
}

export default HeaderCart;
